import React, { Component } from 'react';

import knives from '../components/mockData';
class GetLocalPosts extends Component {
    constructor(props) {
        super(props);
        this.state = {
            knives: knives
        };
    }

    render() {
        const { knives } = this.state;
        return (
            <div>
                <ol className="item">
                    {
                        knives.map(knife => (
                            <div key={knife.id} align="start">
                                <table className='container'>
                                    <thead>
                                        <tr>
                                            <th><h5>Knife</h5></th>
                                            <th><h5>Blade Shape</h5></th>
                                            <th><h5>Steel</h5></th>
                                            <th><h5>For Sale</h5></th>
                                        </tr>
                                    </thead>
                                    <tbody>
                                        <tr>
                                            <td>{knife.brand} {knife.model}</td>
                                            <td>{knife.bladeShape}</td>
                                            <td>{knife.steel}</td>
                                            <td>{knife.forSale}</td>
                                        </tr>
                                    </tbody>
                                </table>
                            </div>
                        ))
                    }
                </ol>
            </div>
        );
    }
  }

  export default GetLocalPosts;
